import React, { Component } from "react";
import Dialog from "@material-ui/core/Dialog";

class DialogBox extends Component {
  render() {
    return (
      <div>
        <Dialog open={this.props.openDialogBox}>
          <h1>hello</h1>
        </Dialog>
      </div>
    );
  }
}
export default DialogBox;
